  [],\n\t\"revision_timestamp\": \"2016-07-27T23:04:46.328990\",\n\t\"name\": \"2004-land-cover-and-land-use-spatial-database-seney-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Geological Survey (USGS) - Upper
  Midwest Environmental Sciences Center (UMESC) has produced a high-resolution land
  cover/land use (LCU) spatial database of Seney National Wildlife Refuge (SNWR).
  The LCU data were interpreted from September 03, 2004 color-infrared (CIR) aerial
  photographs (1:12,000-scale). Vegetation types were classified with refuge-derived
  classes and then linked to the National Vegetation Classification System (NVCS)
  at the Formation level, and whenever possible, the Alliance level. The photos were
  interpreted using a minimum mapping unit of 2-acres (Polygons may be smaller than
  two acres when different modifiers were used within the same class or when mapping
  a significant feature) and a 25% minimum vegetation cover. The photos were interpreted
  to delineate land cover/land use, percent vegetation cover, and tree height. The
  geographic extent of the SNWR LCU database encompasses 95,492 acres of wetland and
  upland habitat in Schoolcraft County, Michigan.\",\n\t\"license_title\": \"License
